script: |
  super -f text -I q3699.spq | sort > q3699.out

inputs:
  - name: q3699.spq
    data: |
      SELECT DISTINCT col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - col2 * - col2 <= ( - col1 + col1 * - col0 - col2 );
  - name: tab1

outputs:
  - name: q3699.out
    data: |
      3
      64
      80
